function love.load()


piso = {
x = 0,
y = 238,
h = 640,
w = 50
}
cuadro = {
x = 0,
y = 0,
h = 30,
w = 30,
vel = 100
}
hb = {
x = 640,
y = 208
}

end

function love.update(dt)

cuadro.y = cuadro.y + cuadro.vel * dt

if cuadro.y > hb.y then

cuadro.y = piso.y - cuadro.h

end

end

function love.draw()
love.graphics.rectangle("line",piso.x,piso.y,piso.h,piso.w)
love.graphics.rectangle("fill",cuadro.x,cuadro.y,cuadro.h,cuadro.w)

end
